import React from 'react';
import { Routes, Route, Link, useNavigate } from 'react-router-dom';
import UploadPage from './UploadPage';
import DisplayPage from './DisplayPage';
import './Tool.css';

function Tool() {
    return (
        <div>
            <h1>Tool Management Page</h1>
            <nav>
                <ul>
                    <li>
                        <Link to="/tool/upload">Upload File</Link>
                    </li>
                    <li>
                        <Link to="/tool/display">Display File</Link>
                    </li>
                </ul>
            </nav>
            <div className="tool">
                <Routes>
                    <Route path="/tool/upload" element={<UploadPage />} />
                    <Route path="/tool/display" element={<DisplayPage />} />
                </Routes>
            </div>
        </div>
    );
}

export default Tool;
